webpackJsonp([0x8415d023044d],{3122:function(e,t){e.exports={pathContext:{docHtml:'<a href="http://promisesaplus.com/">\n    <img src="https://promises-aplus.github.io/promises-spec/assets/logo-small.png" align="right" alt="Promises/A+ logo">\n</a>\n<h1>Request-Promise-Native</h1>\n<p><a href="https://gitter.im/request/request-promise?utm_source=badge&#x26;utm_medium=badge&#x26;utm_campaign=pr-badge&#x26;utm_content=badge"><img src="https://img.shields.io/badge/gitter-join_chat-blue.svg?style=flat-square&#x26;maxAge=2592000" alt="Gitter"></a>\n<a href="https://travis-ci.org/request/request-promise-native"><img src="https://img.shields.io/travis/request/request-promise-native/master.svg?style=flat-square&#x26;maxAge=2592000" alt="Build Status"></a>\n<a href="https://coveralls.io/r/request/request-promise-native"><img src="https://img.shields.io/coveralls/request/request-promise-native.svg?style=flat-square&#x26;maxAge=2592000" alt="Coverage Status"></a>\n<a href="https://david-dm.org/request/request-promise-native"><img src="https://img.shields.io/david/request/request-promise-native.svg?style=flat-square&#x26;maxAge=2592000" alt="Dependency Status"></a>\n<a href="https://snyk.io/test/npm/request-promise-native"><img src="https://snyk.io/test/npm/request-promise-native/badge.svg?style=flat-square&#x26;maxAge=2592000" alt="Known Vulnerabilities"></a></p>\n<p>This package is similar to <a href="https://www.npmjs.com/package/request-promise"><code>request-promise</code></a> but uses native ES6 promises.</p>\n<p>Please refer to the <a href="https://www.npmjs.com/package/request-promise"><code>request-promise</code> documentation</a>. Everything applies to <code>request-promise-native</code> except the following:</p>\n<ul>\n<li>Instead of using Bluebird promises this library uses native ES6 promises.</li>\n<li>Mind that native ES6 promises have fewer features than Bluebird promises do. In particular, the <code>.finally(...)</code> method is not available.</li>\n</ul>\n<h2>Installation</h2>\n<p>This module is installed via npm:</p>\n<pre><code>npm install --save request\nnpm install --save request-promise-native\n</code></pre>\n<p><code>request</code> is defined as a peer-dependency and thus has to be installed separately.</p>\n<h2>Migration from <code>request-promise</code> to <code>request-promise-native</code></h2>\n<ol>\n<li>Go through the <a href="https://github.com/request/request-promise#migration-from-v3-to-v4">migration instructions</a> to upgrade to <code>request-promise</code> v4.</li>\n<li>Ensure that you don\'t use Bluebird-specific features on the promise returned by your request calls. In particular, you can\'t use <code>.finally(...)</code> anymore.</li>\n<li>You are done.</li>\n</ol>\n<h2>Contributing</h2>\n<p>To set up your development environment:</p>\n<ol>\n<li>clone the repo to your desktop,</li>\n<li>in the shell <code>cd</code> to the main folder,</li>\n<li>hit <code>npm install</code>,</li>\n<li>hit <code>npm install gulp -g</code> if you haven\'t installed gulp globally yet, and</li>\n<li>run <code>gulp dev</code>. (Or run <code>node ./node_modules/.bin/gulp dev</code> if you don\'t want to install gulp globally.)</li>\n</ol>\n<p><code>gulp dev</code> watches all source files and if you save some changes it will lint the code and execute all tests. The test coverage report can be viewed from <code>./coverage/lcov-report/index.html</code>.</p>\n<p>If you want to debug a test you should use <code>gulp test-without-coverage</code> to run all tests without obscuring the code by the test coverage instrumentation.</p>\n<h2>Change History</h2>\n<ul>\n<li>\n<p>v1.0.5 (2017-09-22)</p>\n<ul>\n<li>Upgraded <code>tough-cookie</code> to a version without regex DoS vulnerability\n<em>(Thanks to @sophieklm for <a href="https://github.com/request/request-promise-native/pull/13">pull request #13</a>)</em></li>\n</ul>\n</li>\n<li>\n<p>v1.0.4 (2017-05-07)</p>\n<ul>\n<li>Fix that allows to use <code>tough-cookie</code> for <a href="https://github.com/request/request-promise#include-a-cookie">cookie creation</a></li>\n</ul>\n</li>\n<li>\n<p>v1.0.3 (2016-08-08)</p>\n<ul>\n<li>Renamed internally used package <code>@request/promise-core</code> to <code>request-promise-core</code> because there where <a href="https://github.com/request/request-promise/issues/137">too</a> <a href="https://github.com/request/request-promise/issues/141">many</a> issues with the scoped package name</li>\n</ul>\n</li>\n<li>\n<p>v1.0.2 (2016-07-18)</p>\n<ul>\n<li>Fix for using with module bundlers like Webpack and Browserify</li>\n</ul>\n</li>\n<li>\n<p>v1.0.1 (2016-07-17)</p>\n<ul>\n<li>Fixed <code>@request/promise-core</code> version for safer versioning</li>\n</ul>\n</li>\n<li>\n<p>v1.0.0 (2016-07-15)</p>\n<ul>\n<li>Initial version similar to <a href="https://www.npmjs.com/package/request-promise"><code>request-promise</code></a> v4</li>\n</ul>\n</li>\n</ul>\n<h2>License (ISC)</h2>\n<p>In case you never heard about the <a href="http://en.wikipedia.org/wiki/ISC_license">ISC license</a> it is functionally equivalent to the MIT license.</p>\n<p>See the <a href="LICENSE">LICENSE file</a> for details.</p>',docPath:"argo-ci/node_modules/request-promise-native/readme",proj:"argo-ci"}}}});
